import './App.css';
import { ThemeProvider } from '@material-ui/core';
import { theme } from './theme';
import Banner from './components/Banner';

function App() {
  return (
    <ThemeProvider dark theme={theme}>
      <Banner />
    </ThemeProvider>
  );
}

export default App;
